import React from 'react'
import Link from 'next/link'
import { inject, observer } from 'mobx-react'


@inject('store')
@observer

class Mob extends React.Component {
  componentDidMount() {
    this.props.store.set_movies()
  }

  componentWillUnmount() {
    this.props.store.stop()
  }

  render() {
    return (
      <div>

      <h1>
        test
      </h1>
      </div>
    )
  }
}

export default Mob;
